window.bookSummaryJSON = "<p><b>Long-listed, Barnes and Noble Best New Books of the Year, 2024</b></p> <p><b>\"Narrator Daniel Henning brings his signature versatility, emotional connection, and perfect comedic timing to the latest in the acclaimed Cerulean Chronicles series.\"—</b><b><i>AudioFile </i></b><b>(Earphones Award Winner)</b></p> <p><b>\"Daniel Henning’s articulate, earnest narration winningly underscores </b><b><i>Somewhere Beyond the Sea</i></b><b>’s central themes of self-confidence, kindness, acceptance of others and the importance of working for sociopolitical reform.\"—</b><b><i>Bookpage</i></b></p> <p><b><i>Somewhere Beyond the Sea </i></b><b>is the hugely anticipated sequel to TJ Klune's </b><b><i>The House in the Cerulean Sea</i></b><b>, one of the best-loved and best-selling fantasy novels of the past decade.</b></p> <p><i>A magical house. A secret past. A summons that could change everything.</i></p> <p>Arthur Parnassus lives a good life, built on the ashes of a bad one. He’s the headmaster of a strange orphanage on a distant and peculiar island, and he hopes to soon be the adoptive father to the six magical and so-called dangerous children who live there.</p> <p>Arthur works hard and loves with his whole heart so none of the children ever feel the neglect and pain that he once felt as an orphan on that very same island so long ago. And he is not alone: joining him is the love of his life, Linus Baker, a former caseworker in the Department in Charge of Magical Youth; Zoe Chapelwhite, the island’s sprite; and her girlfriend, Mayor Helen Webb. Together, they will do anything to protect the children.</p> <p>But when Arthur is summoned to make a public statement about his dark past, he finds himself at the helm of a fight for the future that his family, and all magical people, deserve.</p> <p>And when a new magical child hopes to join them on their island home—one who finds power in calling himself monster, a name Arthur worked so hard to protect his children from—Arthur knows they’re at a breaking point: their family will either grow stronger than ever or fall apart.</p> <p>Welcome back to Marsyas Island. This is Arthur’s story.</p> <p><i>Somewhere Beyond the Sea</i> is a story of resistance, lovingly told, about the daunting experience of fighting for the life you want to live and doing the work to keep it.</p> <p>Most Anticipated from <i>Goodreads</i>, <i>Paste</i>, <i>Polygon</i>, <i>BookBub</i>, and more.</p> <p><b>A Macmillan Audio production from Tor Books.</b></p>"; 
